// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./KwikTrustNFT.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

contract KwikTrustFactory is AccessControlUpgradeable {
  // Roles role new contract deployment
  bytes32 public constant DEPLOYER_ROLE = keccak256("DEPLOYER_ROLE");

  // mapping to store contract address against contract name
  mapping(string => KwikTrustNFT) public nftContractAddress;

  // event to emit contract address after deployment
  event MintingCreated(address _mintingContract);

  /**
   * @dev Upgradable initializer
   */

  function __KwikTrustFactory_init() external initializer {
    __AccessControl_init();
    _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    grantRole(DEPLOYER_ROLE, msg.sender);
  }

  /**
   * @dev Upgradable initializer
   * @param _name Name of contract
   * @param _symbol Symbol of contract
   * @param _validatorRole lazyminting validator role
   */

  function deployMintingContract(
    string memory _name,
    string memory _symbol,
    address _validatorRole
  ) public {
    require(hasRole(DEPLOYER_ROLE, msg.sender), "0x01");
    KwikTrustNFT nftContract = new KwikTrustNFT(_name, _symbol, msg.sender, _validatorRole);
    nftContractAddress[_name] = nftContract;
    emit MintingCreated(address(nftContract));
  }

  /**
   * @dev Returns the contract address against the contract name
   * @param _contractName NAME of contract
   */

  function getContractAddress(string memory _contractName) public view returns (address) {
    return address(nftContractAddress[_contractName]);
  }
}

